import React from 'react'
import { useDispatch, useSelector } from 'react-redux'

const Demo = () => {

    const dispatch = useDispatch({
        type:'INCREMENT',
        payload:5
    });

    const todos = useSelector((state)=>{
        return state;
    })


  return (
    <>
        <div>{todos}</div>
        <div></div>
    </>
  )
}

export default Demo
